import React, { Component } from "react";

import './scss/components/_wallet.scss';


class Wallet extends Component {
    render() {
     
      return (
          <div className="wallet_wrapper">
          <p className="transaction_history">Transaction history</p>
          <div className="transaction_info">
           
               <p className="date-header">Date</p>  <p  className="summary-header">Summary</p>
               <p class="date">7/30/2019</p>       <p class="summary">Summary</p>
           
          </div>
         
           
          </div>
      )
    }
    };


    
export default Wallet;
